    } 

  }, [userName]);

  return (
    <nav className="navContainer">
      <div className="left-nav">
        <a href="/home">Photo</a>
        <a href="/search/category1/empty">category1</a>
        <a href="/search/category2/empty">category2</a>
        <a href="/search/category3/empty">category3</a>
        <a href="/search/category4/empty">category4</a>
        <a href="/search/category5/empty">category5</a>
      </div>
      <div className="right-nav">
        <a href="/post">Post Item</a>
        <a href="/secret">Username</a>
        {(isAuthenticated) => {
          if (isAuthenticated == true) {
            {
              <a href="/secret">{userName}</a>;
            }
          } else {
            <a href="/signup">Sign Up</a>;
          }
        }}
      </div>
    </nav>
  );
}
